// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.18;

contract PaymentSystem {
    mapping(address => uint256) public riderBalances;
    mapping(address => uint256) public driverBalances;

    event PaymentSent(address indexed sender, address indexed recipient, uint256 amount);

    constructor() {
        address[] memory riders = new address[](4);
        riders[0] = address(0xc814FD5B49f9564dc2FFB42018c67FC8cFd70686);
        riders[1] = address(0x233f1320C329312Ba98534b62E7B79a26d52a7EF);
        riders[2] = address(0x445e9bE1C0A1050d1143A149498d60Ff91bBbBDD);
        riders[3] = address(0x91AC40503FaDb96f6bF3661F440ce2B0c1B059a1);

        uint256 initialRiderBalance = 1000 ether;
        uint256 initialDriverBalance = 0;

        for (uint256 i = 0; i < riders.length; i++) {
            riderBalances[riders[i]] = initialRiderBalance;
            driverBalances[riders[i]] = initialDriverBalance;
        }
    }

    function sendPayment(address rider, address driver, uint256 amount) external {
        require(amount > 0, "Amount must be greater than zero");
        require(riderBalances[rider] >= amount, "Insufficient balance");

        riderBalances[rider] -= amount;
        driverBalances[driver] += amount;

        emit PaymentSent(rider, driver, amount);
    }

    function getRiderBalance(address rider) external view returns (uint256) {
        return riderBalances[rider];
    }

    function getDriverBalance(address driver) external view returns (uint256) {
        return driverBalances[driver];
    }
}

